<!DOCTYPE html><head>    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />    <meta http-equiv="X-UA-Compatible" content="IE=EDGE" />    <title>VisuAlgo - Test Answer Key</title>    <link rel="icon" type="image/png" href="img/favicon.png" />    <!--css-->    <link rel="stylesheet" href="css/normalize.css">    <link rel="stylesheet" href="css/common.css">    <link rel="stylesheet" href="css/viz.css">    <link rel="stylesheet" href="css/test_common.css">    <link rel="stylesheet" href="css/answerkey.css">    <!--js-->    <script src="js/external/jquery-1.10.2.js"></script>    <script src="js/external/d3.v3.js"></script>    <script src="js/common.js"></script>    <script src="js/test/test_mode_constant.js"></script>    <!--more scripts are below-->    <!--fonts-->    <link href="fonts/silkscreen/stylesheet.css" rel='stylesheet' type='text/css'>    <!--link href='http://fonts.googleapis.com/css?family=PT+Sans:400,700' rel='stylesheet' type='text/css'-->    <link href='css/local.css' rel='stylesheet' type='text/css'></head>        <body>    <div id="top-bar">        <a id="home" href="http://www.comp.nus.edu.sg/~stevenha" target="_top"><span class="colour">7</span></a>&nbsp;&nbsp;        <a id="home" href="http://visualgo.net" target="_top">Visu<span class="colour">Algo</span></a>&nbsp;&nbsp;&nbsp;        <span id="title">            <a class="selected-viz" href="answerkey.html">Test Answer Key</a>        </span>                <div id="fb-root"></div>        <a class="right-links" id="scoreboard-link" href="scoreboard.html" target="_blank">Test Scoreboard</a>    </div>    <div id="test-status-error">        <h1>No answer key is not open at the moment.</h1>    </div>    <div id="login-screen">        <h1>All is revealed!</h1>        <form>            <div style="font-size: 14px; margin-bottom: 5px;">                <b>Select Test:</b> <select id="test-selection"></select>            </div>            <input id="login-id" type="text" value="user id" autocomplete="off"/><br/>            <input id="login-pw" type="text" value="password"/><br/>            <input id="login-go" type="submit" value="LOG IN" />            <div id="login-err"></div>        </form>    </div>    <div id="test-screen">        <div id="qn-no"></div>        <div id="qn-text">            <p></p>            <div id="subset"></div>            <div id="mcq"></div>            <input class="number-input" style="width:80px;" type="text" autocomplete="off" title="Enter the numeric value"/>            <div id="current-selection"></div>            <div id="ans-key"></div>        </div>        <div id="viz"></div>        <div id="info">            <div id="student-name"></div>            <div id="infoscore"></div>        </div>        <div id="question-nav"></div>    </div>    <div id="left-bar"></div>    <div id="right-bar"></div>    <!-- Bottom bar and overlay popups -->    <div id="bottom-bar">        <a id="trigger-about">About</a>        <a id="trigger-team">Team</a>        <a id="trigger-terms">Terms of use</a>    </div>    <div id="dark-overlay"></div>    <div id="about" class="overlays"></div>    <div id="team" class="overlays"></div>    <div id="termsofuse" class="overlays"></div>    <div id="custom-alert" class="overlays">        <div class="content"><p></p></div>    </div>    <script src="js/graph_library/constant.js"></script>    <script src="js/graph_library/properties.js"></script>    <script src="js/graph_library/helperObjects.js"></script>    <script src="js/graph_library/misc.js"></script>    <script src="js/graph_library/Widget.js"></script>    <script src="js/graph_library/GraphWidget.js"></script>    <script src="js/graph_library/GraphVertexWidget.js"></script>    <script src="js/graph_library/GraphEdgeWidget.js"></script>    <script src="js/test/test_common.js"></script>    <script src="js/test/answerkey.js"></script>    <script src="js/test/answer_interface.js"></script>    <script src="js/test/question_processing.js"></script></body></html>
